import React from 'react';

const History = ({ userState, setUserState }) => {
    console.log(userState.data.login);
    const idSet = new Set();
    idSet.add(userState.data.login);

    return (
        idSet &&
        idSet.map((id) => {
            <div>id</div>;
        })
    );
};

export default History;
